import React from 'react'
import "../style.scss"

const Cart = () => {
  return (
    <div className='Cart'>
        <div style={{backgroundImage: URL("https://www.google.com/url?sa=i&url=https%3A%2F%2Fpixabay.com%2Fimages%2Fsearch%2Ftshirt%2F&psig=AOvVaw2-ERMwup8yx1dAA7Qr34jR&ust=1668500352865000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCICNzsCerfsCFQAAAAAdAAAAABAE")}}>
            
       </div>
    </div>
  )
}

export default Cart
